import { useEffect, useState } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import { Container } from 'react-bootstrap';
import axios from 'axios';

function Lobby() {
  const { sessionId } = useParams();
  const navigate = useNavigate();

  const playerId = localStorage.getItem('playerId');
  const [error, setError] = useState(null);

  const image64 = 'data:image/png;base64,';

  useEffect(() => {
    if (!playerId) {
      setError("Missing playerId");
      return;
    }

    const interval = setInterval(async () => {
      try {
        const res = await axios.get(`http://localhost:5005/play/${playerId}/status`);
        if (res.data.gameState === 'ACTIVE' && res.data.position >= 0) {
            navigate(`/play/${sessionId}/game`);
          }          
      } catch (err) {
        setError('Failed to check game status');
      }
    }, 1000);

    return () => clearInterval(interval);
  }, [playerId, sessionId, navigate]);

  if (error) {
    return <Container className="mt-5 text-center text-danger">{error}</Container>;
  }

  return (
    <Container className="d-flex flex-column align-items-center justify-content-center" style={{ height: '100vh' }}>
      <h2 className="mb-4 text-center">Waiting for the game to begin...</h2>
      <img
        src={image64}
        alt="Waiting Animation"
        style={{ maxWidth: '300px', marginBottom: '2rem' }}
      />
      <em>ChiPiChiPi , QaPaQaPA</em>
    </Container>
  );
}

export default Lobby;
